import axios from 'axios';

const fetchInfo = async () => {
  const { data } = await axios.get('http://localhost:5000/test')
}

fetchInfo();

function App() {
  return (
    <div>
      <h1>{ data }</h1>
    </div>
  );
}

export default App;
